import {memo, ReactNode} from 'react'
type templateProps={
    children : ReactNode 
}
const FlexTemplate = memo(({children}:templateProps)=>{
    return(
        <div style={{display:'flex' , flexDirection:'row',flexWrap:'wrap',alignItems:'center',justifyContent:'center',paddingLeft:'5px'}}>
            {children}
        </div>
    )

})

export default FlexTemplate;
